import React from "react"
import './App.css';
import Flashcards from "./Flashcard";

import Header from "./Header"

function App(){
  return (
    <div className="Background">
      <div className="App">
        <Header />

        <body>
          <Flashcards />
        </body>
      </div>

    </div>
  )
}

export default App;
